import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
import './project.css';



export default function Project() {
  // Sample project data
  const projects = [
    {
      title: 'Project One',
      description: 'Elephant Incident Reporting System, a mobile application designed to revolutionize the management of HEC. At its core, the system offers registered users a seamless platform for reporting and sharing elephant-related incidents, fostering community engagement and awareness. ',
      imgSrc: '../img/',
      githubLink: 'https://github.com/IT20639662/project-one',
    },
    {
      title: 'Project Two',
      description: 'Mobile app development with React Native.',
      imgSrc: 'https://via.placeholder.com/300x180',
      githubLink: 'https://github.com/IT20639662/project-two',
    },
    {
      title: 'Project Three',
      description: 'Automated testing with Selenium WebDriver.',
      imgSrc: 'https://via.placeholder.com/300x180',
      githubLink: 'https://github.com/IT20639662/project-three',
    },
    {
      title: 'Project Four',
      description: 'E-commerce platform with Angular and Firebase.',
      imgSrc: 'https://via.placeholder.com/300x180',
      githubLink: 'https://github.com/IT20639662/project-four',
    },
    {
      title: 'Project Five',
      description: 'Data analysis and visualization using Python.',
      imgSrc: 'https://via.placeholder.com/300x180',
      githubLink: 'https://github.com/IT20639662/project-five',
    },
    {
      title: 'Project Six',
      description: 'Personal portfolio website built with React.',
      imgSrc: 'https://via.placeholder.com/300x180',
      githubLink: 'https://github.com/IT20639662/project-six',
    },
  ];

  return (
    <>
      <Header />
      <div className="projects-container">
        <h1 className="projects-title">My Projects</h1>
        <div className="projects-grid">
          {projects.map((project, index) => (
            <Card className="project-card" key={index}>
              <Card.Img variant="top" src={project.imgSrc} alt={project.title} />
              <Card.Body>
                <Card.Title>{project.title}</Card.Title>
                <Card.Text>{project.description}</Card.Text>
                <Button
                  variant="primary"
                  href={project.githubLink}
                  target="_blank"
                  rel="noopener noreferrer"
                >
                  View on GitHub
                </Button>
              </Card.Body>
            </Card>
          ))}
        </div>
      </div>
      <Footer />
    </>
  );
}
